import React from 'react';
import './Loading.css';

const Loading: React.FC = () => {
  return (
    <div className="loading-container">
      <div className="car-loader">
        {/* Real car SVG */}
        <svg 
          className="real-car"
          viewBox="0 0 200 80" 
          xmlns="http://www.w3.org/2000/svg"
        >
          {/* Car body */}
          <path 
            d="M20 50 L180 50 L170 30 L150 20 L50 20 L30 30 Z" 
            fill="url(#carGradient)" 
            stroke="#333" 
            strokeWidth="1"
          />
          
          {/* Windows */}
          <path 
            d="M40 25 L160 25 L150 35 L50 35 Z" 
            fill="#1a1a1a" 
            opacity="0.8"
          />
          
          {/* Wheels */}
          <circle cx="60" cy="55" r="12" fill="#2d2d2d" stroke="#444" strokeWidth="2"/>
          <circle cx="140" cy="55" r="12" fill="#2d2d2d" stroke="#444" strokeWidth="2"/>
          <circle cx="60" cy="55" r="6" fill="#666"/>
          <circle cx="140" cy="55" r="6" fill="#666"/>
          
          {/* Headlights */}
          <circle cx="175" cy="35" r="4" fill="#fff" opacity="0.9">
            <animate attributeName="opacity" values="0.9;0.5;0.9" dur="2s" repeatCount="indefinite"/>
          </circle>
          
          {/* Taillights */}
          <circle cx="25" cy="35" r="3" fill="#ff0000">
            <animate attributeName="opacity" values="0.8;1;0.8" dur="1s" repeatCount="indefinite"/>
          </circle>
          
          {/* Door handles */}
          <rect x="80" y="32" width="8" height="2" fill="#666" rx="1"/>
          <rect x="112" y="32" width="8" height="2" fill="#666" rx="1"/>
          
          {/* Side mirrors */}
          <ellipse cx="45" cy="25" rx="3" ry="4" fill="url(#carGradient)"/>
          <ellipse cx="155" cy="25" rx="3" ry="4" fill="url(#carGradient)"/>
          
          {/* License plate */}
          <rect x="85" y="45" width="30" height="8" fill="#fff" stroke="#ccc" strokeWidth="1"/>
          <text x="100" y="51" textAnchor="middle" fontSize="6" fill="#000" fontWeight="bold">ABC123</text>
          
          {/* Grille */}
          <rect x="165" y="40" width="8" height="4" fill="#333" rx="1"/>
          
          {/* Exhaust */}
          <circle cx="30" cy="48" r="2" fill="#666" opacity="0.6">
            <animate attributeName="opacity" values="0.6;0;0.6" dur="1.5s" repeatCount="indefinite"/>
          </circle>
          
          {/* Gradients */}
          <defs>
            <linearGradient id="carGradient" x1="0%" y1="0%" x2="100%" y2="0%">
              <stop offset="0%" style={{stopColor: '#bb86fc', stopOpacity: 1}} />
              <stop offset="50%" style={{stopColor: '#a855f7', stopOpacity: 1}} />
              <stop offset="100%" style={{stopColor: '#9333ea', stopOpacity: 1}} />
            </linearGradient>
          </defs>
        </svg>
        
        {/* Exhaust particles */}
        <div className="exhaust"></div>
        <div className="exhaust"></div>
        <div className="exhaust"></div>
      </div>
      <div className="road-line"></div>
      <p>Loading cars...</p>
    </div>
  );
};

export default Loading;
